import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import 'bootstrap/dist/css/bootstrap.css';

class Register_box extends React.Component {

    render() {
        return (
            <form>
                <div className="d-flex flex-nowrap">
                    <div className="order-3 p-2">First flex item</div>
                    <div className="order-2 p-2">Second flex item</div>
                    <div className="order-1 p-2">Third flex item</div>
                </div>
            </form>
        );
    }
}

class New_SX extends React.Component {
    render() {
        return (
            <div className="new_sx">
                <div className="register_box" >
                    <Register_box />
                </div>
            </div>
        );
    }
}

// ========================================

ReactDOM.render(
    <New_SX />,
    document.getElementById('root')
);
